import React, { useState, useEffect } from "react";
import "./css/main.css";

const TestingFetchingData = () => {
  const [backendData, setbackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => {
        setbackendData(data);
      });
  }, []);

  return (
    <div className="fetchdata-container">

    </div>
  );
};

export default TestingFetchingData;
